import React from "react";
import PropTypes from "prop-types";
import { makeStyles } from "@material-ui/core/styles";
import AppBar from "@material-ui/core/AppBar";
import Tabs from "@material-ui/core/Tabs";
import Tab from "@material-ui/core/Tab";
import Typography from "@material-ui/core/Typography";
import Box from "@material-ui/core/Box";
import Group from "views/Group/Group"
import Dash from "views/Dashboard/Dashboard"
import Captain from "views/Captain/Captain"
import MyTeam from "views/MyTeam/MyTeam"
import Match from "views/UpcomingMatch/UpcomingMatch"
import Stats from "views/Statistics/Statistics"

function TabPanel(props) {
  const { children, value, index, ...other } = props;

  return (
    <div
      role="tabpanel"
      hidden={value !== index}
      id={`simple-tabpanel-${index}`}
      aria-labelledby={`simple-tab-${index}`}
      {...other}
    >
      {value === index && (
        <Box p={3}>
          <Typography>{children}</Typography>
        </Box>
      )}
    </div>
  );
}

TabPanel.propTypes = {
  children: PropTypes.node,
  index: PropTypes.any.isRequired,
  value: PropTypes.any.isRequired
};

function a11yProps(index) {
  return {
    id: `simple-tab-${index}`,
    "aria-controls": `simple-tabpanel-${index}`
  };
}

const useStyles = makeStyles((theme) => ({
  root: {
    flexGrow: 1,
    backgroundColor: theme.palette.background.paper
  }
}));

export default function CricDreamTabs() {
  const classes = useStyles();
  const [value, setValue] = React.useState(0);

  const handleChange = (event, newValue) => {
    if (newValue !== value) setValue(newValue);
  };

  return (
    <div className={classes.root}>
      <AppBar position="static">
        <Tabs
          value={value}
          onChange={handleChange}
          aria-label="simple tabs example"
        >
          <Tab label="Group" {...a11yProps(0)} />
          <Tab label="DashBoard" {...a11yProps(1)} />
          <Tab label="Captain" {...a11yProps(2)} />
          <Tab label="Team" {...a11yProps(3)} />
          <Tab label="Match" {...a11yProps(4)} />
          <Tab label="Stats" {...a11yProps(5)} />
        </Tabs>
      </AppBar>
      <TabPanel value={value} index={0}>
        <Group />
      </TabPanel>
      <TabPanel value={value} index={1}>
        <Dash/>
      </TabPanel>
      <TabPanel value={value} index={2}>
        <Captain/>
      </TabPanel>
      <TabPanel value={value} index={3}>
        <MyTeam/>
      </TabPanel>
      <TabPanel value={value} index={4}>
        <Match/>
      </TabPanel>
      <TabPanel value={value} index={5}>
        <Stats/>
      </TabPanel>
    </div>
  );
}
